@import "reset";
@import "variables";
@import "info-section";
@import "home";
@import "resume";

* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

body,
html {
  font-size: 18px;
  font-family: 'Barlow Semi Condensed', sans-serif;
  height: 100vh;
  background: $color1;
}

.menu-icon {
  // background: red;
  position: fixed;
  top: 36px;
  right: 36px;
  padding: 20px;
  z-index: 11;
  cursor: pointer;

  .fas {
    color: $color1;
    font-size: 2rem;
  }
}

.primary-btn {
  background: $color1;
  -webkit-border-radius: 30px;
  -moz-border-radius: 30px;
  border-radius: 30px;
  text-align: center;
  text-decoration: none;
  color: $color3;
  padding: 15px 30px;
  display: inline-block;
  text-transform: uppercase;
  letter-spacing: 3px;
  margin-right: 15px;
  transition: $btnTransitions;

  &:hover {
    background: black;
  }
}

.ghost-btn {
  border: 4px solid $color1;
  -webkit-border-radius: 30px;
  -moz-border-radius: 30px;
  border-radius: 30px;
  text-align: center;
  text-decoration: none;
  color: $color1;
  padding: 12px 27px;
  display: inline-block;
  text-transform: uppercase;
  letter-spacing: 3px;
  transition: $btnTransitions;

  &:hover {
    border-color: black;
    color: black;
    // background: $color4;
  }
}

#menu {
  background-color: $color1;
  position: fixed;
  width: 100%;
  top: 0;
  bottom: 0;
  z-index: 10;
  display: flex;
  align-items: center;
  justify-content: center;
  opacity: 1;
  transform: translate3d(-100%,0,0);
  transition: all 0.8s ease-in-out;

  nav {
    width: 400px;
    text-align: center;

    a {
      display: block;
      font-size: 2.3rem;
      padding: 1rem;
      text-decoration: none;
      color: white;

      &:hover {
        color: $color5;
      }
    }
  }
}

.menu-active {
  .menu-icon {
    .fas {
      color: black;
    }
  }

  #menu {
    width: 100%;
    // opacity: 1;
    top: 0;
    bottom: 0;
    transform: translate3d(0,0,0);
  }
}
